output_json = []

for row in range(value.getRowCount()):
	row_object = {}

	row_value = {}
	cell_style = {}

	for col in range(value.getColumnCount()):    
		row_value[value.getColumnName(col)] = {'value': value.getValueAt(row, col), 'style': {}}
		cell_style = {}

		HiHiLimit = None
		HiLimit   = None
		LoLimit   = None
		LoLoLimit = None
		CurrValue = None

		try:
			if 'TestValues' in value.getColumnName(col):
				if value.getValueAt(row, 'TestAttributeDataType') == 'Integer':
					HiHiLimit = int(value.getValueAt(row, 'HiHiLimit'))
					HiLimit   = int(value.getValueAt(row, 'HiLimit'))
					LoLimit   = int(value.getValueAt(row, 'LoLimit'))
					LoLoLimit = int(value.getValueAt(row, 'LoLoLimit'))
					CurrValue = int(value.getValueAt(row, col))
				elif value.getValueAt(row, 'TestAttributeDataType') == 'Float':
					HiHiLimit = float(value.getValueAt(row, 'HiHiLimit'))
					HiLimit   = float(value.getValueAt(row, 'HiLimit'))
					LoLimit   = float(value.getValueAt(row, 'LoLimit'))
					LoLoLimit = float(value.getValueAt(row, 'LoLoLimit'))
					CurrValue = float(value.getValueAt(row, col))

				if CurrValue <> None and (CurrValue >= HiHiLimit or CurrValue <= LoLoLimit):
					cell_style = {
						'background-color': '#f00',
						'color': '--neutral-10'
					}
				elif CurrValue <> None and ((CurrValue < HiHiLimit and CurrValue >= HiLimit) or (CurrValue <= LoLimit and CurrValue > LoLoLimit)):
					cell_style = {
						'background-color': '#ff0',
						'color': '--neutral-10'
					}
		except:
			pass

		row_value[value.getColumnName(col)]['style'] = cell_style
		row_object['value'] = row_value

	output_json.append(row_object)

return output_json
